import React from 'react';
import OrderTable from '../../components/OrderTable';
const tarProps = {
    dbName: "testDB",
    keys: {
        name: {
            type: "input",
            text: "姓名"
        },
        text: {
            type: "input",
            text: "文字"
        },
        money: {
            type: "input",
            text: "金額"
        },

        time: {
            type: "datePicker",
            text: "時間"
        },
        remarks: {
            type: "textArea",
            text: "備註"
        }
    }
};

const tarData = [
    {
        id: 0,
        text: "t1",
        money: "hello",
        name: "hello2",
        time: "2021-09-15",
        remarks: "no"
    },
    {
        id: 1,
        text: "t2",
        money: "apple",
        name: "apple2",
        time: "2021-09-17",
        remarks: "no2"
    },
    {
        id: 2,
        text: "t3",
        money: "dog",
        name: "dog2",
        time: "2021-09-19",
        remarks: "no3"
    }
];
function Order() {
    return (
        <div>
            <OrderTable tarProps={tarProps} tarData={tarData} />
        </div>
    );
}

export default Order;
